import React, { Component } from 'react';

class Options extends Component {
  constructor(props) {
    super(props)
    this.state = {
      playtime: '5',
      fundamental: '440',
      shape: 'sine',
      root: 'I',
      rootBNS: 'n',
      triad: 'Major',
      seventh: 'none',
      ninth: 'none',
      eleventh: 'none',
      thirteenth: 'none',
    }
  }

  changeOption(option, e) {

  }

  render() {
    return (
      <form>
      <PlayTime
        value={this.state.playtime}
        change={(e) => this.setState({playtime: e.target.value})}
      />
      <br/>
        <Fundamental
          value={this.state.fundamental}
          change={(e) => this.setState({fundamental: e.target.value})}
        />
        <br/>
        <Root
          value={this.state.root}
          change={(e) => this.setState({root: e.target.value})}
        />
        <RootBNS
          value={this.state.rootBNS}
          change={(e) => this.setState({rootBNS: e.target.value})}
        />
        <br/>
        <Triad
          value={this.state.triad}
          change={(e) => this.setState({triad: e.target.value})}
        />
        <br/>
        <Seventh
          value={this.state.seventh}
          change={(e) => this.setState({seventh: e.target.value})}
        />
        <br/>
        <Ninth
          value={this.state.ninth}
          change={(e) => this.setState({ninth: e.target.value})}
        />
        <br/>
        <Eleventh
          value={this.state.eleventh}
          change={(e) => this.setState({eleventh: e.target.value})}
        />
        <br/>
        <Thirteenth
          value={this.state.thirteenth}
          change={(e) => this.setState({thirteenth: e.target.value})}
        />
        <br/>
        <div onClick={() => console.log(this.state)}>Log State</div>
        <br/>
      </form>
    )
  }
}

function PlayTime(props) {
  return (
    <div>
    Play Time (s):
    <input type="text" name="PlayTime"
    defaultValue={props.value} onChange={props.change}/>
    </div>
  )
}

function Fundamental(props) {
  return (
    <div>
    Fundamental (Hz):
    <input type="text" name="Fundamental"
    defaultValue={props.value} onChange={props.change}/>
    </div>
  )
}

function Shape(props) {
  return (
    <div>
    Shape:
    <select defaultValue={props.value} onChange={props.change}>
      <option value='sine'>sine</option>
      <option value='triangle'>triangle</option>
      <option value='saw'>saw</option>
      <option value='square'>square</option>
    </select>
    </div>
  )
}

function Root(props) {
  return (
    <div>
    Root:
    <select defaultValue={props.value} onChange={props.change}>
      <option value='I'>I</option>
      <option value='II'>II</option>
      <option value='III'>III</option>
      <option value='IV'>IV</option>
      <option value='V'>V</option>
      <option value='VI'>VI</option>
      <option value='VII'>VII</option>
    </select>
    </div>
  )
}

function RootBNS(props) {
  return (
    <div>
      BNS:
      <label>b
        <input type="radio" value="b"
        checked={props.value === 'b'}
        onChange={props.change}/>
      </label>
      <label>n
        <input type="radio" value="n"
        checked={props.value === 'n'}
        onChange={props.change}/>
      </label>
      <label>s
        <input type="radio" value="s"
        checked={props.value === 's'}
        onChange={props.change}/>
      </label>
    </div>
  )
}

function Triad(props) {
  return (
    <div>
      Triad:
      <select defaultValue={props.value} onChange={props.change}>
        <option value="Major">Major</option>
        <option value="Minor">Minor</option>
        <option value="Augmented">Augmented</option>
        <option value="Diminished">Diminished</option>
        <option value="Sus4">Sus4</option>
        <option value="Sus2">Sus2</option>
      </select>
    </div>
  )
}

function Seventh(props) {
  return (
    <div>
      Seventh:
      <label>none
        <input type='radio' value='none'
        checked={props.value === 'none'}
        onChange={props.change}/>
      </label>
      <label>b
        <input type='radio' value='b'
        checked={props.value === 'b'}
        onChange={props.change}/>
      </label>
      <label>n
        <input type='radio' value='n'
        checked={props.value === 'n'}
        onChange={props.change}/>
      </label>
      <label>s
        <input type='radio' value='s'
        checked={props.value === 's'}
        onChange={props.change}/>
      </label>
    </div>
  )
}

function Ninth(props) {
  return (
    <div>
      Ninth:
      <label>none
        <input type='radio' value='none'
        checked={props.value === 'none'}
        onChange={props.change}/>
      </label>
      <label>b
        <input type='radio' value='b'
        checked={props.value === 'b'}
        onChange={props.change}/>
      </label>
      <label>n
        <input type='radio' value='n'
        checked={props.value === 'n'}
        onChange={props.change}/>
      </label>
      <label>s
        <input type='radio' value='s'
        checked={props.value === 's'}
        onChange={props.change}/>
      </label>
    </div>
  )
}

function Eleventh(props) {
  return (
    <div>
      Eleventh:
      <label>none
        <input type='radio' value='none'
        checked={props.value === 'none'}
        onChange={props.change}/>
      </label>
      <label>b
        <input type='radio' value='b'
        checked={props.value === 'b'}
